Multiline comments should begin and end with the open-comment and close-comment on separate lines or line up each part of the multiline comment.

assign code = pvalue; -orassign code = pvalue; 

/* This is one of the correct formats for a multiline comment in a section of code. */

assign code = pvalue;

It is also acceptable to line up each part of the multiline comment as shown.

// This is the correct format for a multiline // comment in a section of code /* This is the correct format for a multiline * comment a section of code. */ 

assign code = pvalue; It is okay to indent the comment From the open-comment and close-comment

* It is acceptable to line up all the stars
